import React, { Component } from "react";

export default class ItemSinhVien extends Component {
  render() {
    let { sv } = this.props;
    return (
      <tr>
        <td>{sv.id}</td>
        <td>{sv.name}</td>
        <td>{sv.email}</td>
        <td>{sv.phone}</td>
        <td className="flex">
          <button>Sửa</button>
          <button>Xoá</button>
        </td>
      </tr>
    );
  }
}
